import React from 'react';
import './Header.css';
import logo from '../../assets/images/logo.png';


const Header = () => {
  return (
    <header className="header">
      <div className="header-logo">
      <img src={logo} alt="Logo" className="img-logo"/>
      </div>
      <p className="link">Entrar</p>
    </header>
  );
};

export default Header;
